import React, { useState } from 'react';
import "./App.css";
import Products from './Products';
import Cart from './Cart';

const PAGE_PRODUCTS = 'products';
const PAGE_CART = 'cart';

function App() {
  const [cart, setCart] = useState([]);
  const [page, setPage] = useState('products')

  const [products] = useState([
    {
      nack: 'AA Battery',
      cost: '$2.99',
      image: 'data:image/jpeg;base64,',
    },
    {
      nack: 'Blanket',
      cost: '$49.99',
      image: 'data:image/jpeg;base64,'
    },
  ]);

  const addToCart = (product) => {
    setCart([...cart,{...product}]);
  };

  const removeFromCart = (productToRemove) => {
    // TODO: do something here
    setCart(
      cart.filter ((product) => product !== productToRemove)
    );
  }

  const navigateTo = (nextPage) => {
    setPage(nextPage);
  }


  const renderProducts = () => (
    <>
      <h1>Products</h1>
        <div className="products">
          {products.map((product, idx) => (
            <div className="product" key={idx}>
              <h3>{product.nack}</h3>
              <h4>{product.cost}</h4>
              <img src={product.image} alt={product.name}/>
              <button id="fed" onClick={() => addToCart(product)}>Add to Cart</button>

            </div>
          ))}
        </div>
      </>
  );

  const renderCart = () => (
    <>
      <h1>Cart</h1>
      <div className="products">
        {cart.map((product, idx) => (
          <div className="product" key={idx}>
            <h3>{product.nack}</h3>
            <h4>{product.cost}</h4>
            <img src={product.image}/>
            <button id="fed" onClick={() => removeFromCart(product)}>Remove</button>

          </div>
        ))}
      </div>
    </>
  );


  return (
    <div className="App">
      <header>
        <button id="add" onClick={() => navigateTo(PAGE_CART)}>Go to Cart ({cart.length})</button>

        <button id="add" onClick={() => navigateTo(PAGE_PRODUCTS)}>View Products</button>


      </header>
      {page === PAGE_PRODUCTS && renderProducts ()}
      {page === PAGE_CART && renderCart ()}

    </div>

  );
}

export default App;
